import React from "react";
import { Generation1 } from "./Generation/Generation1";
import styled from "styled-components";

export const Contact = () => {
  return (

      <>
      <ContStyle>
        <div className="info">
          <h1>Contact Info:</h1>
          <ul>
            <a href="https://www.linkedin.com/in/dcm91/" ><li>https://www.linkedin.com/in/dcm91/</li></a>
            <li>https://github.com/DCM91</li>
            <li>castromartindaniel91@gmail.com</li>
          </ul>
      </div>
    </ ContStyle>

    <Generation1 /></>

  );
};

const ContStyle = styled.div`
.info{
  display: flex;
  margin-left: 2.5rem;
  margin-top: 150px;
  margin-bottom: -5rem;
  height: 8rem;
  width: 15rem
}
h1{
  color: #fee4e5;
  font-style: italic;
  margin-right: 1.5rem;
  font-family: fantasy;
}
li{
  font-size: medium;
  font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
  color: #312F30;
}
`
